import React, { useEffect, useState } from 'react';
import './ClientStyle.css';
import axios from 'axios';
import SockJS from 'sockjs-client';
import { Stomp } from '@stomp/stompjs';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, TextField, MenuItem } from '@mui/material';
import { Line } from 'react-chartjs-2'; // Import pentru grafice
import 'chart.js/auto'; // Necesită pentru grafice
import { useNavigate } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const ClientPage = () => {
    const [devices, setDevices] = useState([]);
    const [selectedDevice, setSelectedDevice] = useState(null); // Dispozitivul selectat
    const [selectedDate, setSelectedDate] = useState(''); // Ziua selectată
    const [consumptionData, setConsumptionData] = useState(null); // Datele consumului
    const [error, setError] = useState('');
    const userId = localStorage.getItem('userId');
    const navigate = useNavigate();

    const handleSignOut = () => {
        localStorage.removeItem('role');
        localStorage.removeItem('userId');
        navigate('/');
    };

    const fetchDevices = async () => {
        if (!userId) {
            setError('User ID is not available');
            return;
        }
        try {
            const response = await axios.get(`http://localhost:8082/api/user_device/${userId}/owned_devices`);
            setDevices(response.data);
        } catch (err) {
            console.error(err);
            setError('Failed to fetch devices');
        }
    };

    const fetchConsumptionData = async () => {
        if (!selectedDevice || !selectedDate) return;

        try {
            const response = await axios.get(`http://localhost:8082/api/devices/${selectedDevice.id}/consumption`, {
                params: { date: selectedDate }
            });
            setConsumptionData(response.data);
        } catch (err) {
            console.error(err);
            setError('Failed to fetch consumption data');
        }
    };

    const connectToNotifications = () => {
        const socket = new SockJS('http://localhost:8086/websocket');
        const stompClient = Stomp.over(socket);

        stompClient.connect({}, (frame) => {
            console.log('Connected: ' + frame);

            stompClient.subscribe('/topic/notifications', (notification) => {
                const message = notification.body;
                toast.info(message, {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                    progress: undefined,
                });
            });
        }, (error) => {
            console.error("WebSocket connection failed:", error);
        });
    };

    useEffect(() => {
        fetchDevices();
        connectToNotifications();
    }, [userId]);

    useEffect(() => {
        fetchConsumptionData();
    }, [selectedDevice, selectedDate]);

    const renderChart = () => {
        if (!consumptionData) return <p>Select a device and a date to view consumption data.</p>;

        const hours = consumptionData.map((entry) => entry.hour);
        const values = consumptionData.map((entry) => entry.value);

        const data = {
            labels: hours,
            datasets: [
                {
                    label: 'Energy Consumption (kWh)',
                    data: values,
                    borderColor: 'rgba(75,192,192,1)',
                    backgroundColor: 'rgba(75,192,192,0.2)',
                    tension: 0.1,
                },
            ],
        };

        return <Line data={data} />;
    };

    return (
        <div className="client-dashboard">
            <h2>Client Dashboard</h2>
            {error && <p style={{ color: 'red' }}>{error}</p>}
            <Button variant="contained" color="secondary" onClick={handleSignOut} style={{ marginBottom: '20px' }}>
                Sign Out
            </Button>

            <h3 className="devices-title">Your Devices</h3>
            {devices.length > 0 ? (
                <div>
                    <TextField
                        select
                        label="Select Device"
                        value={selectedDevice?.id || ''}
                        onChange={(e) => {
                            const device = devices.find((d) => d.id === e.target.value);
                            setSelectedDevice(device);
                        }}
                        style={{ marginBottom: '20px', width: '200px' }}
                    >
                        {devices.map((device) => (
                            <MenuItem key={device.id} value={device.id}>
                                {device.description}
                            </MenuItem>
                        ))}
                    </TextField>

                    <TextField
                        label="Select Date"
                        type="date"
                        InputLabelProps={{ shrink: true }}
                        value={selectedDate}
                        onChange={(e) => setSelectedDate(e.target.value)}
                        style={{ marginBottom: '20px', width: '200px' }}
                    />

                    {renderChart()}
                </div>
            ) : (
                <p>No devices found.</p>
            )}

            <ToastContainer />
        </div>
    );
};

export default ClientPage;
